// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.4;

contract RandomChoice {
    uint private randNonce = 0;
 
    event number (
        uint256 val
    );

    // Defining a function to generate
    // a random number
    function randMod(uint _modulus) public returns(uint val)
    {
        if (randNonce < type(uint256).max - 1) randNonce++; else randNonce = 1;
        val = uint(keccak256(abi.encodePacked(block.timestamp,msg.sender,randNonce))) % _modulus;
        emit number(val);
    }


    function choice1000(uint percentageVal, uint _modulus) public returns(uint256) {
        uint256 counter = 0;
        for (uint256 c=0; c<100; c++) {
            if ( percentageVal >= randMod(_modulus)) counter++;
        }
        return counter;
    }

    function choice(uint percentageVal, uint _modulus) public returns(bool) 
        { return percentageVal >= randMod(_modulus); }

    function choiceInArray(uint256[] memory arr) public returns (uint256 rt) {
        for (uint i=0; ;i++) {
            if (i==arr.length-1) i=0;
            if (choice(arr[i], 100)) { rt = i; break; }
        }
    }


    function chouseNType (uint256 module) public returns (uint256[5] memory vals) 
        { for (uint i=1; i<=5; i++) { vals[i] = randMod(module); } }

}
